import React from 'react';
import Algorithm from './Algorithm';
import PropTypes from 'prop-types';

class Algorithms extends React.Component {
    state = {
        algorithms: [
          {
            name: 'sar',
            description: 'cos tam1'
          },
          {
            name: 'mm',
            description: 'cos tam2'
          },
          {
            name: 'uknn',
            description: 'cos tam3'
          }
        ]
      }

    render() {
        return this.state.algorithms.map(
            (algorithm) => (
                <Algorithm key={algorithm.name} picked={this.props.picked} algorithm={algorithm} pickedAlgorithm={this.props.pickedAlgorithm}/>
            )
        );
    }
}

Algorithms.propTypes = {
    algorithms: PropTypes.array.isRequired
}

export default Algorithms;
